import { Menu, Input, Button, Popover } from 'antd';

const ProfileAvatar = () => {
    return (
        <Menu.Item key="profile">
            <Popover placement="bottom" trigger="hover">
                <Avatar shape="square" icon={<UserOutlined />} />
            </Popover>
        </Menu.Item>
    );
}

export default ProfileAvatar;
